import "./style.css"
// import Container from "../Container";

class login extends Component {


    handleSubmitAuth = (event) => {
        event.preventDefault()
        console.log("chubby bunny")
    }


    render() {
        return (
            <div id="formoutline">
                <h5>Employee Login</h5>
                <form>
                    <input class="login" id="emailInput" placeholder="Email"></input>
                    <input class="login" id="passwordInput" placeholder="Password"></input>
                </form>
                <button id="submit" onClick={() => this.handleSubmitAuth()} >Submit</button>
            </div>
        );
    }
}

export default loginForm;
